import { createStore, applyMiddleware, combineReducers } from 'redux';
import thunk from 'redux-thunk';
import { persistStore, persistReducer } from 'redux-persist';

import cars from './cars';
import vins from './vins';
import vinAudit from './vinAudit';
import email from './email';
import years from './getYears';
import makes from './getMakes';
import models from './getModels';
import trims from './getTrims';

const reducer = combineReducers({
    vinAudit,
    cars, 
    vins,
    email, 
    years,
    makes,
    models,
    trims
})

// export default () => {
//     let store = createStore( persistReducer, reducer, applyMiddleware(thunk) )
//     let persistor = persistStore(store)
//     return { store, persistor}
// }

export default createStore(
    persistReducer,
    reducer, 
    applyMiddleware(thunk)
)

